script: |
  super -f text -I q11295.spq | sort > q11295.out

inputs:
  - name: q11295.spq
    data: |
      SELECT + col1 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) BETWEEN + col0 AND cor0.col2 OR ( col0 * - col0 ) BETWEEN NULL AND col1;
  - name: tab0

outputs:
  - name: q11295.out
    data: |
